// @flow strict

const Navigation = ({ next, previous }: Props) => {
	console.log(next, previous);
	return (
		<React.Fragment>
			{!!next && <button onClick={() => setQuery(next)}>Next</button>}
			{!!previous && <button onClick={() => setQuery(previous)}>Previous</button>}
		</React.Fragment>
	)
}

export { Navigation };
